-- Volcando estructura para procedimiento gim_escuela.sp_listaAlumnos
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_listaAlumnos`()
BEGIN
	SELECT
       a.id_alumno,
       a.id_tutor,
       a.tipo_doc as id_tipo_doc,
       td.descripcion as tipo_doc,
       a.numdoc,
       a.apepat,
       a.apemat,
       a.nombres,
       DATE_FORMAT(a.fecha_nac, '%d/%m/%Y') as fecha_nac,
       a.sexo,
       a.departamento,
       a.provincia,
       a.distrito,
       a.direccion,
       a.essalud,
       a.cia_seguro as id_cia_seguro,
       sm.descripcion as cia_seguro,
       a.enfermedades,
       a.alergias,
       a.nombre_mama,
       a.apepat_mama,
       a.apemat_mama,
       a.tel_fijo_mama,
       a.tel_cel_mama,
       a.email_mama,
       a.nombre_papa,
       a.apepat_papa,
       a.apemat_papa,
       a.tel_fijo_papa,
       a.tel_cel_papa,
       a.email_papa,
       a.estado
	FROM gim_alumnos a
	LEFT JOIN gim_tipo_documento td ON a.tipo_doc = td.id_tipo_documento
	LEFT JOIN gim_seguro_medico sm ON a.cia_seguro = sm.id_seguro_medico;
	
END//
DELIMITER ;


