-- Volcando estructura para procedimiento gim_escuela.sp_listaHistorialMatricula
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_listaHistorialMatricula`(IN `p_id_alumno` INT(11))
BEGIN

	SELECT
	h.clase
	,fn_nombreMes(m.mes_matricula) as mes_matricula
	,m.anio_matricula
	,DATE_FORMAT(m.fecha_matricula,'%d/%m/%Y') as fecha_matricula
	,m.importe
	,(m.importe - m.saldo) as importe_pagado
	,m.saldo 
	FROM gim_matricula m
	inner join gim_horarios h ON m.id_horario = h.id_horario  
	WHERE m.id_alumno = p_id_alumno 
	AND m.estado = 'V'
	ORDER BY m.fecha_matricula DESC
	LIMIT 0,6;

END//
DELIMITER ;


-- Volcando estructura para procedimiento gim_escuela.sp_listaHorarios
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_listaHorarios`()
SELECT 
h.id_horario
,h.dias as id_dias
,d.descripcion as dias
,h.edades as id_edades
