-- Volcando estructura para procedimiento gim_escuela.sp_reporteAlumnosClase
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporteAlumnosClase`(IN `p_mes` INT(2), IN `p_anio` INT(4), IN `p_id_horario` INT(11))
BEGIN
		
	IF p_id_horario <> 0 THEN
		SELECT 
		m.anio_matricula
		,m.mes_matricula
		,m.id_horario
		,h.clase as horario
		,m.id_profesor
		,p.nombre_corto as profesor
		,m.id_alumno
		,CONCAT(a.apepat,' ',a.apemat) as apellidos_alumno
		,a.nombres as nombres_alumno
		,m.saldo
		,CONCAT(t.apepat,' ',t.apemat,' ',t.nombres) as tutor
		,t.telefono as telefono_tutor
		,t.celular as celular_tutor
		,t.email as email_tutor
		FROM gim_matricula m
		inner join gim_horarios h ON m.id_horario = h.id_horario
		inner join gim_profesores p ON m.id_profesor = p.id_profesor
		inner join gim_alumnos a ON m.id_alumno = a.id_alumno
		inner join gim_tutores t ON t.id_tutor = a.id_tutor
		WHERE m.mes_matricula = p_mes
		AND m.anio_matricula = p_anio
		AND m.id_horario = p_id_horario;
	ELSE
		SELECT 
		m.anio_matricula
		,m.mes_matricula
		,m.id_horario
		,h.clase as horario
		,m.id_profesor
		,p.nombre_corto as profesor
		,m.id_alumno
		,CONCAT(a.apepat,' ',a.apemat) as apellidos_alumno
		,a.nombres as nombres_alumno
		,m.saldo
		,CONCAT(t.apepat,' ',t.apemat,' ',t.nombres) as tutor
		,t.telefono as telefono_tutor
		,t.celular as celular_tutor
		,t.email as email_tutor
		FROM gim_matricula m
		inner join gim_horarios h ON m.id_horario = h.id_horario
		inner join gim_profesores p ON m.id_profesor = p.id_profesor
		inner join gim_alumnos a ON m.id_alumno = a.id_alumno
		inner join gim_tutores t ON t.id_tutor = a.id_tutor
		WHERE m.mes_matricula = p_mes
		AND m.anio_matricula = p_anio;
	END IF;	

END//
DELIMITER ;


-- Volcando estructura para procedimiento gim_escuela.sp_reporteDeudasMatriculados
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporteDeudasMatriculados`()
BEGIN
	SELECT 
	m.id_horario
	,h.clase as horario
	,m.anio_matricula
	,m.mes_matricula
	,s.descripcion as sexo
	,e.descripcion as edades
	,d.descripcion as dias
	/*,m.id_profesor
	,p.nombre_corto as profesor*/
	,m.id_alumno
	,CONCAT(a.apepat,' ',a.apemat) as apellidos_alumno
	,a.nombres as nombres_alumno
	
	,CONCAT(t.apepat,' ',t.apemat) as apelliidos_tutor
	,t.nombres as nombres_tutor
	,t.telefono as telefono_tutor
	,t.celular as celular_tutor
	,t.email as email_tutor
	,m.importe as total
	,(m.importe - m.saldo) as pago
	,m.saldo
	FROM gim_matricula m
	inner join gim_horarios h ON m.id_horario = h.id_horario
	inner join gim_sexo s ON s.id_sexo = h.sexo
	inner join gim_edades e ON e.id_edad = h.edades
	inner join gim_dias d ON d.id = h.dias
	/*inner join gim_profesores p ON m.id_profesor = p.id_profesor*/
	inner join gim_alumnos a ON m.id_alumno = a.id_alumno
	inner join gim_tutores t ON t.id_tutor = a.id_tutor
	WHERE m.saldo > 0;
END//
DELIMITER ;


