CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveCabCobro`(IN `p_ruc_empresa` VARCHAR(11), IN `p_tipo_comprobante` INT(2), IN `p_nro_serie` VARCHAR(3), IN `p_nro_correlativo` INT(11), IN `p_fecha_emision` DATE, IN `p_id_pedido` INT(11), IN `p_tipo_documento` INT(2), IN `p_numdoc` VARCHAR(11), IN `p_cliente` VARCHAR(200) CHARSET latin1, IN `p_direccion` TEXT, IN `p_forma_pago` INT(2), IN `p_subtotal` DECIMAL(12,2), IN `p_igv` DECIMAL(12,2), IN `p_total` DECIMAL(12,2))
BEGIN
	DECLARE vIdCobro 	INT(11); 

    ruc_empresa
    ,tipo_comprobante
    ,nro_serie
    ,nro_correlativo
    ,fecha_emision
    ,id_pedido
    ,tipo_documento
    ,numdoc
    ,cliente
    ,direccion
    ,forma_pago
    ,subtotal
    ,igv
    ,total
    ,auditoria_ingreso
    ,auditoria_actualizacion
    ,estado
    )
    VALUES
    (
    p_ruc_empresa
    ,p_tipo_comprobante
    ,p_nro_serie
    ,p_nro_correlativo
    ,p_fecha_emision
    ,p_id_pedido
    ,p_tipo_documento
    ,p_numdoc
    ,p_cliente
    ,p_direccion
    ,p_forma_pago
    ,p_subtotal
    ,p_igv
    ,p_total
    ,NOW()
    ,NOW()
    ,'V'
    );
    
    SET vIdCobro = LAST_INSERT_ID();
	SELECT vIdCobro;
END//
DELIMITER ;


