-- Volcando estructura para procedimiento gim_escuela.sp_updCorrelativo
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_updCorrelativo`(IN `p_ruc_empresa` VARCHAR(20), IN `p_id_forma_pago` INT(2))
BEGIN

    IF p_id_forma_pago = 1 THEN
		UPDATE gim_parametros 
		SET nro_ticket = (nro_ticket + 1)
		WHERE numdoc = p_ruc_empresa;
    END IF;
    
    IF p_id_forma_pago = 2 THEN
		UPDATE gim_parametros 
		SET nro_boleta = (nro_boleta + 1)
		WHERE numdoc = p_ruc_empresa;
    END IF;
    
    IF p_id_forma_pago = 3 THEN
		UPDATE gim_parametros 
		SET nro_factura = (nro_factura + 1)
		WHERE numdoc = p_ruc_empresa;
    END IF;

END//
DELIMITER ;


